g application. An assessment of the impact of the development on the source protection zone is to be submitted as part of any planning application.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.396915,0.294317],"size":0.78},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR23","site-address":"Chelsfield Depot, Shacklands Road, Badgers Mount","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.335335","longitude":"0.150226","hectares":"3.35","minimum-net-dwellings":"100","maximum-net-dwellings":"100","start-date":"2017-11-01","end-date":"","notes":"Emerging Local Plan Ref ST2-43 - Respect and respond sensitively to the existing features within the site that are positive and that make the site unique. The site is especially unique because of its natural landscape buffer that surrounds the site on all sides. Buffer required to protect the ancient woodland. Proposals could explore integrating a use within the site that benefits from the natural landscape buffer the site affords, such as a community activity centre or forest school. Establish a network of connected streets which prioritise walking and cycling over private car use for short trips within the development. Create safe, attractive and clear cycling and pedestrian routes which minimise distances between the site and local shops, services and Knockholt station. Proposals should especially consider improvements to the roundabout to the southwest of the site that accommodates footpaths and crossings for pedestrians and cyclists. Any opportunity to deliver a new pedestrian connection through to Highland Road or Charles Road to overcome the isolation of this site would be welcome. Use the natural features of the site to inform development and integrate it into its wider setting. The topography, geology, trees and ancient woodland can be used to reinforce local distinctiveness.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.335335,0.150226],"size":3.35},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR31","site-address":"Upper Hockenden Farm, Hockenden Lane, Swanley","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.405454","longitude":"0.155817","hectares":"2.36","minimum-net-dwellings":"25","maximum-net-dwellings":"25","start-date":"2017-11-01","end-date":"","notes":"Emerging Local Plan Ref ST2-23 - Retain existing employment floorspace as part of any scheme. A contamination assessment is to be submitted as part of any planning application. An air quality assessment is to be submitted as part of any planning application.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.405454,0.155817],"size":2.36},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR32","site-address":"Harringtons Nursery, Highlands Hill, Swanley","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.403705","longitude":"0.18708","hectares":"0.4","minimum-net-dwellings":"16","maximum-net-dwellings":"16","start-date":"2017-11-01","end-date":"","notes":"Emerging Local Plan Ref ST2-24 - Respect and respond sensitively to the existing features within the site that are positive and that make the site unique. In particular, development on this site might capture the spirit of the regular pattern of glasshouses on the site. New development should front onto the public footpath across the north side of the site\r\nwhich connects towards Swanley Village, identifying this as a public route. Create safe, attractive and clear walking and cycling routes which minimise distances between the site and Hextable village, Swanley town and Swanley Station. Proper pedestrian and cycling facilities need to be introduced along Highlands Hill, connecting to the Fiveways Junction. This is to ensure that the development can be safely accessed on foot or by cycle to enable sustainable and independent travel. Explore ways of reflecting the sites existing use as a nursery into proposals for development. This could include incorporating a particularly strong planting approach.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.403705,0.18708],"size":0.4},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR56","site-address":"Deer Leap Stud Farm, Knockholt Road, Halstead","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.32627","longitude":"0.129986","hectares":"0.39","minimum-net-dwellings":"13","maximum-net-dwellings":"13","start-date":"2017-11-01","end-date":"","notes":"Emerging Local Plan Ref ST2-55 - Careful design and layout to minimise impact on the amenity of neighbouring properties.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.32627,0.129986],"size":0.39},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR63","site-address":"Egerton Nursery, Egerton Avenue, Hextable","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.407338","longitude":"0.181036","hectares":"0.52","minimum-net-dwellings":"30","maximum-net-dwellings":"30","start-date":"2017-11-01","end-date":"","notes":"Emerging Local Plan Ref ST2-59 - Careful design and layout to minimise impact on the openness of the Green Belt in this important strategic gap. Access to be improved","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.407338,0.181036],"size":0.52},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR64","site-address":"Oasis Academy, Egerton Avenue, Hextable","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.405454","longitude":"0.155817","hectares":"3.18","minimum-net-dwellings":"190","maximum-net-dwellings":"190","start-date":"2017-11-01","end-date":"","notes":"Emerging Local Plan Ref ST2-60 - Respect and respond sensitively to the existing features within the site that are positive and that make the site unique. The Howard Venue is a valued asset well used by the local community and should be retained on the site. The strong orthogonal character of the existing site should inform the development of future development structure through a simple gridded block structure. The historic avenue of trees along the western boundary of the site provides an opportunity to create well defined built frontage facing onto landscape rather than the backs of buildings. Be fully integrated into the existing urban fabric by responding to the village character of Hextable in terms of scale, materials and layout. Use the existing perimeter block street pattern to the east of the site on Egerton Avenue and New Road to inform the layout of housing on site. Establish a network of connected streets which prioritise walking and cycling over private car use for short trips within the development. The structure of the site should naturally extend the existing grain of streets. The development of the site provides a good opportunity to introduce a new pedestrian link from the elbow of Egerton Avenue towards the south and west to connect into the top of Swanley Park. Create safe, attractive and clear cycling and pedestrian routes which minimise distances between the site and local shops, services and public transport interchanges. Ensure a hierarchy of routes so that important routes are clearly identifiable. Use the natural features of the site to inform development and integrate it into its wider setting. The topography, geology and trees can be used to reinforce local distinctiveness. In particular, the existing avenue of trees along the western edge of the site should help to provide a strong characteristic for the site.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.405454,0.155817],"size":3.18},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR71","site-address":"Former Birchwood Primary School, Russett Way, Swanley","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"yes","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.405334","longitude":"0.166434","hectares":"0.66","minimum-net-dwellings":"39","maximum-net-dwellings":"39","start-date":"2017-11-01","end-date":"","notes":"Emerging Local Plan Ref ST2-22 - Retain existing trees and hedges","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.405334,0.166434],"size":0.66},{"entry-date":"2019-01-18","organisation":"local-authority-eng:SEV","site":"BFR76","site-address":"Stacklands Retreat House, School Lane","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_regis 2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR104","site-address":"Fort Halstead, Crow Drive, TN14 7BU","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"outline planning permission","hazardous-substances":"yes","latitude":"51.312698","longitude":"0.146808","hectares":"62.66","minimum-net-dwellings":"750","maximum-net-dwellings":"750","start-date":"2017-11-01","end-date":"","notes":"SE/15/00628/OUT Emerging Local Plan Ref ST2-57 - Site has outline planning permission for 450 residential dwellings and 27,000m2 business floorspace. The additional housing units must form part of a comprehensive redevelopment of the site to include replacement employment provision. This should be of an equivalent scale and skill level to that when the site was fully operational to ensure the Districts economy remains dynamic. Any additional development proposed must conserve and enhance the AONB. Any additional development proposed will be required to be of high quality design and careful layout, provide a buffer to protect the ancient woodland, and protect priority habitats. Landscaping and planting should be integrated into the development and will be required to provide a buffer and defensible boundary in order to blend the development into the countryside in a natural and sensitive way. Respect and respond sensitively to the existing features within the site that are positive\r\nand that make the site unique. Fort Halstead, a designated Scheduled Monument and of\r\nhistoric military significance, should be protected, enhanced and better presented in any development proposal. Improve the provision and connectivity of green infrastructure including improvements to the Public Right of Way network. Multiple access points will be required to serve the development. Any scheme will need to be supported by a transport assessment, setting out any required mitigation measures, safe access for all and focusing on sustainable transport solutions. If one element of the site is available for redevelopment in advance of the other, the development should be designed in such a way so as not to preclude the future integration of development, or the operation of the existing functions.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.312698,0.146808],"size":62.66},{"entry-date":"2017-12-01","organisation":"local-authority-eng:SEV","site":"BFR105","site-address":"Bramblefield Close and Park Drive, Hartley, DA3 7RT","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"51.395643","longitude":"0.299238","hectares":"5.5","minimum-net-dwellings":"71","maximum-net-dwellings":"71","start-date":"2017-11-01","end-date":"","notes":"SE/13/02032","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.395643,0.299238],"size":5.5},{"entry-date":"2017-12-01","organisation":"local-authority-eng:SEV","site":"BFR106","site-address":"West Kent Cold Store, Rye Lane, TN14 5HD","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"51.292542","longitude":"0.172127","hectares":"7.5","minimum-net-dwellings":"500","maximum-net-dwellings":"500","start-date":"2017-11-01","end-date":"","notes":"SE/09/02635 - Completed","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.292542,0.172127],"size":7.5},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR107","s n in the town centre will be required. Servicing, parking and access arrangements will need careful consideration once the mix of uses is determined. Development should improve pedestrian linkages to the town centre","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.270147,0.190973],"size":0.6},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR115","site-address":"Station Approach, Edenbridge","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.199033","longitude":"0.06847","hectares":"1","minimum-net-dwellings":"30","maximum-net-dwellings":"30","start-date":"2017-12-01","end-date":"","notes":"Emerging Local Plan Ref ST2-29 - The area of employment land on the northern portion of site should be retained; including the historic train-shed brick building on site. The southern end of the site is allocated for residential use. A landscaped buffer will be required to protect residential amenity and provide benefits to biodiversity adjacent to the railway. Access to employment land should be taken from the existing access on Station Approach. Access to residential development should be taken from Greenfield. Safety enhancements such as signing and lining are likely to be required at the junction of Greenfield and Forge Croft. Safe and convenient links should be made to the footpath network to the south of the site.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.199033,0.06847],"size":1},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR116","site-address":"New Ash Green Village Centre, New Ash Green","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.366246","longitude":"0.304785","hectares":"1.87","minimum-net-dwellings":"70","maximum-net-dwellings":"70","start-date":"2017-12-01","end-date":"","notes":"Emerging Local Plan Ref ST2-37 - New Ash Green village centre will be regenerated and the quality of the environment improved so that it more effectively meets the needs of the community. Development should retain a scale appropriate to the size of the community it is intended to serve and a form that respects the distinctive character of the settlement. Development should achieve a satisfactory relationship with the adjoining housing and open space. Proposals should include retail, employment and community facilities and services. Office space should be retained or provided in this central location. An element of residential\r\ndevelopment (in the form of apartments) should be included as part of the regeneration scheme. The scheme should provide improvements to the local centre public realm. Servicing, parking and access arrangements will need careful consideration once the mix of uses is determined and a Transport Assessment will be required. Parking should be reprovided as part of the scheme, including parking for residential units. The pedestrian environment should be designed to provide a safe and secure access incorporating security measures (such as the public realm overlooked by residential development) to deter crime, the fear of crime and antisocial behaviour. Developers will be required to demonstrate that there is adequate waste water capacity both on and off the site to serve the development and that it would not lead to problems for existing or new users. In some circumstances it may be necessary for developers to fund tudies to ascertain whether the proposed development will lead to overloading of existing water infrastructure.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6 t runs along the west of the site should be explored to integrate the site into the neighbourhoods on either side and improve the quality of the environment along these routes. Establish a network of connected streets which prioritise walking and cycling over private\r\ncar use for short trips within the development. Proposals should especially consider safe and clear pedestrian and cycle routes to New Ash Green village centre. This might require improvement to the existing route that connects the shops with North Ash Road via Over Minnis. Principal vehicle access to the site will be from North Ash Road. Use the natural features of the site to inform development and integrate it into its wider setting. The trees can be used to reinforce local distinctiveness. Proposals should respect the values of the original New Ash Green masterplan by incorporating communal landscaped spaces with planting and trees into development proposals.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.363787,0.305343],"size":1.03},{"entry-date":"2019-12-18","organisation":"local-authority-eng:SEV","site":"BFR123","site-address":"The Forge, Ash Road, New Ash Green","site-plan-url":"https://maps.sevenoaks.gov.uk/brownfield_register/","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"51.363269","longitude":"0.298107","hectares":"0.29","minimum-net-dwellings":"29","maximum-net-dwellings":"29","start-date":"2018-12-01","end-date":"","notes":"Emerging Local Plan Ref ST2-39 - Careful design and layout to minimise impact on the amenity of neighbouring properties. The review of the existing use is to be considered as part of any planning application.","resource":"c84876116a22210cb82eb5144dea2f94913745a11a6bd0a06e6f4ecbc15f643f","point":[51.363269,0.298107],"size":0.29},{"entry-date":"2019-12-18","organisation":"local-authority-eng:
